INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (24, "カオリ（サマー）", 0.0, 4, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2019/07/31 12:00:00", 24015, "2030/12/17 14:59:59", 1, 0.0, 10021, 110501, 4);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (24, "カオリ（サマー）", 0.0, 1, 4.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2019/07/31 12:00:00", 24016, "2030/12/17 14:59:59", 2, 0.0, 10021, 110501, 4);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (24, "カオリ（サマー）", 0.0, 4, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2019/07/31 12:00:00", 24017, "2030/12/17 14:59:59", 3, 0.0, 10021, 110501, 4);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (24, "カオリ（サマー）", 0.0, 2, 5.2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2019/07/31 12:00:00", 24018, "2030/12/17 14:59:59", 4, 0.0, 10021, 110501, 1);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (24, "カオリ（サマー）", 0.0, 6, 4.2, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2019/07/31 12:00:00", 24019, "2030/12/17 14:59:59", 5, 0.0, 10021, 110501, 5);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (24, "カオリ（サマー）", 0.0, 2, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2019/07/31 12:00:00", 24020, "2030/12/17 14:59:59", 6, 0.0, 10021, 110501, 2);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (24, "カオリ（サマー）", 0.0, 6, 6.4, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2019/07/31 12:00:00", 24021, "2030/12/17 14:59:59", 7, 0.0, 10021, 110501, 1);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (24, "カオリ（サマー）", 0.0, 2, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2019/07/31 12:00:00", 24022, "2030/12/17 14:59:59", 8, 0.0, 10021, 110501, 2);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (24, "カオリ（サマー）", 0.0, 3, 10.08, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2019/07/31 12:00:00", 24023, "2030/12/17 14:59:59", 9, 0.0, 10021, 110501, 6);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (24, "カオリ（サマー）", 0.0, 2, 5.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2019/07/31 12:00:00", 24024, "2030/12/17 14:59:59", 10, 0.0, 10021, 110501, 1);
INSERT INTO `v1_703982dc46bd7b1713493f5efdba7771ad3612a2fc02bbd67225f5fabe0f48b2` VALUES (24, "カオリ（サマー）", 0.0, 2, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2019/07/31 12:00:00", 24025, "2030/12/17 14:59:59", 11, 0.0, 10021, 110501, 2);
